import React from 'react';
import '../Form.css'

class Coupon extends React.Component{

    render(){
        return <div className="form__orderContainer--coupon">
                    <h6>Have a coupon? <a href="#"><span>Click here to enter your code</span></a></h6>
               </div>     
    }
}

export default Coupon;
